import './App.css';
import { createBrowserRouter,RouterProvider} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  const router=createBrowserRouter([
    {
      path:"/",
      element:<><Navbar /></>
    },
    {
      path:"/about",
      element:<><Navbar /></>
    },
    {
      path:"/home",
      element:<><Navbar /><Home/></>
    },
    {
      path:"/services",
      element:<><Navbar /></>
    },
    {
      path:"/contactus",
      element:<><Navbar /></>
    },
    {
      path:"/login",
      element:<><Navbar /></>
    },
    {
      path:"/signup",
      element:<><Navbar /></>
    }
  ])

  return (
    <>
    <RouterProvider router={router}/>
    </>
  );
}

export default App;
